MIP-58: Lock/Mint-type Native Bridge with trusted Relayer Description : Proposes a lock/mint-type Native Bridge that capitalizes on the trust-assumption on the Relayer. Authors : Primata , Andreas Penzkofer Approval : Abstract We propose a lock/mint-type Native Bridge. The lock/mint bridge design streamlines operations, enhances security, and improves user experience (compared to the previously employed HTLC-based Native Bridge) making it easier to bridge assets between chains. Motivation Different types of bridges have been considered for the Native Bridge, see MIP-60 . The initial design employed a HTLC-based bridge, which has been found to lead to bad UX, requires four transactions, and a complex design. This proposal advocates for replacing the current HTLC-based bridge design, with a lock/mint-type bridge with a simpler and more efficient two-transaction mechanism. The proposed design reduces costs, enhances security, minimizes user friction, and avoids potential exploits caused by refund logic. It addresses long-standing issues such as reliance on sponsored transactions, outdated audits, and unimplemented fee mechanisms speeding the process to achieve a fully functional bridge that movement yet has been unable to complete, and lots of under issues raised and still pending. Reminder: HTLC-based bridge The HTLC-type Native Bridge design poses numerous challenges, including inefficiency, cost, and user frustration: Transaction complexity Requires four interactions: Two by the user (initiate the transfer and finalize the transfer). One by the Relayer to complete the transfer. One by a third party (tasked to the Relayer) to finalize refunds in case of failure. If any of these fails, users and the operator face losses. High cost The multi-transaction setup is expensive for both users and the operator. Estimations in fee calculation that are too far off can result in significant losses. If fees are miscalculated by 25%, this leads to a 25% loss. When L1 fees increase, the loss can escalate dramatically in absolute terms. Unfriendly user experience The current design requires users to have funds on the target chain for finalization. This increases friction and discourages adoption. Sponsored transactions are essential to the current implementation but remain unimplemented, leaving users stranded without funds. Security risks Relayer keys are a critical point of failure. This assumption cannot be avoided. Refund logic introduces vulnerabilities where attackers could exploit the rate limit and Relayer downtime. For instance, if the Relayer fails to finalize on the initiator, a malicious actor could: Take over the refund keys. Exploit both directions of the bridge (e.g., $L1MOVE→$L2MOVE and $L2MOVE→$L1MOVE) repeatedly, draining funds. Maintenance burden The current design requires a complete UI/UX overhaul, adding complexity and delay. Unnecessary complexity HTLC-based bridges are largely abandoned in favor of simpler, more effective designs. Examples like the Consensys HTLC bridge demonstrate the pitfalls of such approaches . Infrastructure simplification Infrastructure is still incomplete for the current HTLC bridge design and we are struggling to find sound solutions that balance UI/UX and security. For example, this issue regarding UX vs number of confirmations to require on the Ethereum side, is still under debate. Because of the over-engineered design, infrastructure is prone to error and we might end up being damaged by the amount of infrastructure we have not built yet and has to be built for the Relayer to fully function. We could strip down the Relayer code and achieve a final design much more quickly. Protocol simplification (compared to HTLC-based Native Bridge) The proposed lock/mint bridge design mitigates these issues, creating a safer, faster, and user-friendly bridge while maintaining operational reliability. Combine lock and completion functionality on the counterparty contract. Remove refund logic to streamline operations and improve security. Cheaper transactions because of reduction of logic. Consolidate Initiator and Counterparty into a single contract (this might be the most dangerous thing proposed but it has already been proposed for HTLC Native Bridge implementation). Specification The key words "MUST", "MUST NOT", "REQUIRED", "SHALL", "SHALL NOT", "SHOULD", "SHOULD NOT", "RECOMMENDED", "NOT RECOMMENDED", "MAY", and "OPTIONAL" in this document are to be interpreted as described in RFC 2119 and RFC 8174. The lock/mint bridge design focuses on minimizing complexity and maximizing security. It also leverages the trust assumption on the Relayer to streamline operations and enhance user experience. Components The following components are involved L1 Native Bridge contract The contract to which a user can request a bridge transfer L1→L2 and through which the Relayer completes transfers L2→L1. L2 Native Bridge contract The contract to which a user can request a bridge transfer L2→L1 and through which the Relayer completes transfers L1→L2. L1 token pool An address which collects \ that are transferred L1→L2 and from which tokens are released when transferred L2→L1. L2 Mint contract A contract capable of minting \. Governance operator An entity that can set the bridge fee and adjust the rate limit. Rate limiter A mechanism that limits the number of tokens that can be transferred. The rate limitation is discussed in MIP-74 . (Partially trusted) Relayer An off-chain partially trusted component (except for bugs or theft of keys) that can read relevant events from either chain and processes transfer requests by completing them on the target chain. It MAY operate nodes on both chains to learn about the finalization of complete_transfer transactions. The operation of the Relayer, including the bootstrapping process, is detailed in MIP-61 . Storage fields The storage fields are directional, hence we need to mirror the mapping for L1→L2, as well as L2→L1. Hence, we will talk about source and target chain. Source bridge contract struct SourceBridgeTransfers { /// A list of unique bridge transfer IDs. bridge_transfer_ids: Vec<u64>, /// A mapping of `bridge_transfer_id` to the bridge details. bridge_transfer: HashMap<u64, SourceBridgeDetails>,
} /// Details of a bridge transfer on the source chain.
struct SourceBridgeDetails { /// The address of the user initiating the bridge transfer. originator: Address, /// The address of the user receiving the bridge transfer. recipient: Address, /// The amount of tokens being transferred. amount: u128, /// A unique identifier for each bridge transfer, incremented by the contract. nonce: u64,
} Target bridge contract struct TargetBridgeTransfers { /// A list of unique bridge transfer IDs. bridge_transfer_ids: Vec<u64>, /// A mapping of `bridge_transfer_id` to the bridge details. bridge_transfer: HashMap<u64, TargetBridgeDetails>,
} /// Details of a bridge transfer on the target chain.
struct TargetBridgeDetails { /// The address of the user initiating the bridge transfer. originator: String, // or `Address` if using an Ethereum-compatible type /// The address of the user receiving the bridge transfer. recipient: String, /// The amount of tokens being transferred. amount: u128, /// A unique identifier for each bridge transfer, incremented by the contract. nonce: u64,
} Transaction flow [!NOTE] This bridge design is a simpler version compared to the previous HTLC-based implementation, thus less steps are required to complete a bridge transfer. The bridge is initiated by the user and completed by the Relayer. The Relayer is a trusted party that finalizes the bridge transfer on the target chain. The user is not required to have funds on the target chain to complete the transfer. The Relayer is responsible for completing the transfer on the target chain. There are two possible states, transfer_initiated or transfer_completed. User initiates the transfer. Relayer completes the transfer with parameter validation. Current HasuraDB built internally can provide enough infrastructure for users to know if their transaction has been completed. It does not differ from the current (HTLC-based) design in any way since user is not able to see if their transaction is in-flight. We could introduce this by notifying the user if the Relayer has been ordered to complete the transaction. sequenceDiagram participant User participant Source_Contract as Source Chain Contract participant Relayer participant Target_Contract as Target Chain Contract User ->> Source_Contract: Initiate Transfer Source_Contract -->> Relayer: Emit Transfer Event Relayer ->> Target_Contract: Complete Transfer Target_Contract -->> User: Tokens Delivered Figure: Interaction flow diagram. Transaction History Figure: Users would be able to see if the bridge has been completed. It's either pending or completed. Protocol description L1 → L2 User initiates a bridge transfer on L1 via a initiate_transfer transaction. Contract stores a mapping of the user bridgeTransferId for easy access. It transfers from the user \ to the contract. The transaction emits originator, recipient, amount and a nonce. Relayer awaits for finalization of the initiate_transfer transaction on L1. Relayer sends a complete_transfer transaction on L2 to complete the transfer. The contract verifies that the transaction is correct by comparing the provided bridgeTransferId hash and the emitted values of originator, recipient, amount and nonce. Finally, it mints \ and sends it to the recipient address. User is notified on the frontend that their transaction has been completed. The time to finality for the complete transaction on the L2 should be considered after the postconfirmation, see MIP-37 , to provide strong finality guarantees. [!NOTE] Postconfirmation is an anchoring mechanism for the L2 to the L1. It provides additional reorg protection. We MAY consider Fastconfirmation instead of Postconfirmation, see MIP-65 . This assumes the L2 is extremely unlikely to reorg AND the committee is considered to be safe. L1-L2 L2 → L1 User initiates a bridge transfer on L2. Contract stores a mapping of the user nonce to bridge details for easy access. User transfers \ amount to the contract which burns it. The transaction emits originator, recipient, amount and nonce. Relayer awaits for finalization of the transaction on L2. Finality COULD be considered the postconfirmation, see MIP-37 , to provide strong finality guarantees. However, we suggest the Relayer SHOULD consider fastconfirmation, see MIP-65 instead, due to high fluctuation of gas prices on L1 within time that is required for postconfirmation. Nevertheless, this introduces dependency on that the L2 is extremely unlikely to reorg AND the committee is considered to be safe. Relayer completes the transfer on L1 by sending a complete_transfer transaction. L1 contract verifies that complete_transfer is correct by comparing the provided bridgeTransferId hash and the emitted values of initiator, recipient, amount and nonce. Also nonce must not be used yet. Finally, it transfers \ to the recipient address from the locked token pool. User is notified on the frontend that their transaction has been completed. L2-L1 Key features We discuss the key features also in relation to the HTLC-based bridge to provide a comparison with the previous design. Lock/Mint mechanism Initiation : User sends a transaction to initiate the bridge containing recipient and amount. Completion : A Relayer or multi-signature group completes the transfer on the counterparty contract with the originator, recipient, amount and nonce for hash verification. No funds requirement : User is not required to have funds on target chain and we do not have to build sponsored transactions. Delivery by Relayer : Because the Relayer delivers the funds, there is no requirement for the user to complete the transaction on target chain, therefore simplifying the user experience and allowing a smooth onboarding on the network for transfers from L1 to L2. User only has to await for the finalization on the source chain and for the Relayer to perform the completion on target chain. This is standard practice for every major bridge in the ecosystem. Less parameters : Because there is no exchange of secrets between the user and Relayer, we have a substantial reduction of logic. Must complete transfers : Previously we reserve a refunder role to revert transactions. In this approach this is different as we guarantee delivery of funds through the same party that would guarantee funds being refunded, because transfers MUST be completed. Consolidation of logic Merge lock and completion functionality on the counterparty contract. Once lock is called, funds are already in the control of the user. In the HTLC implementation, once the timelock is over and complete on initiator has not been called, both the initiator and counterparty funds are available to the user, opening up for an exploit. Removes the refund functionality entirely to eliminate associated exploits. Parameter validation Ensure parameter validation on the counterparty to prevent invalid transactions. Relayer redundancy Use two types of Relayers: Automated relayer : Operated with minimal human involvement; its private key is highly secured. Multi-signature Relayer : Managed by the team to guarantee transaction completion in case of failures. Cost efficiency Minimize gas costs by reducing the number of interactions and simplifying fee calculations. Enhanced security Avoid refund logic to close exploit windows. Protect against key compromise through key isolation or known by no parties and multi-signature Relayer setups. There is no scenario where a bridge could lead to double-spending. It's either completed by Relayer or not. In the HTLC bridge the user can loose its bridge preImage which could lead to them being unable to complete the bridge. By not relying on a preImage from the user, it minimizes issues. It is not a loss in security because the purpose of the preImage is solely for refunding. Batch processing for downtime Multi-signature Relayers can process multiple pending transactions in a single batch to compensate for downtime. BridgeTransferId Continue using unique identifier to prevent double-spending and track transactions securely. Initial bridge fee proposals On the L1 to L2 bridge, do not charge fees. On the L2 to L1 bridge, charge a fee estimated by admin. It's set to the gas spent in ethereum in move. This requires an oracle and can only be implemented after oracles are live and we are able to have a maintainer that is able to set the fees on L2. entry fun set_fee(caller: &signer, fee: u64) { assert_is_maintainer(caller); borrow_global<BridgeConfig>(@aptos_framework).fee = fee;
} Best practices Adopt currently used bridge designs from established designs like Arbitrum, LayerZero and Blast bridges, which use a Relayer to finalize the bridge. User is not required to have funds on counterparty contract to finalize the bridge. Exploits and potential losses Key compromise The compromise of the Relayer keys would lead to unauthorized transactions, putting the protocol at risk of unlimited value exploit. The protocol must absorb the losses and rotate Relayers. To minimize this risk MIP-74 proposes a rate limitation even for the Relayer. Fee wrong estimation Incorrect fee calculations (e.g., underestimating gas) can cause significant financial losses for the operator. Reference implementation Solidity Implementation Move Implementation (Optional) recommendations Batch completion for multisig Relayer** Multisig Relayers could process pending transactions in batches during downtime of the standard Relayer, ensuring timely resolution. Verification Correctness Simulate multiple transaction scenarios to ensure robustness. Test edge cases, including Relayer downtime and batch processing. Security implications Conduct audits focused on the simplified design. Implement rate-limiting safeguards and validate parameters in contracts. Performance impacts Benchmark gas costs and transaction throughput. Validation procedures Perform an audit and thorough testing, alongside an open invite to the community to verify the bridge. Seek community feedback and incorporate suggestions. Appendix A1: Related issues Movement Issue #838 Movement Issue #842 A2: Gas cost comparison Current Design : ~400k gas per bridge round trip. Simplified Design : ~200k gas per bridge round trip. A3: Referenced designs Arbitrum Bridge Blast Bridge Changelog

