diff --git a/aptos-move/framework/aptos-framework/sources/genesis.move b/aptos-move/framework/aptos-framework/sources/genesis.move
--- a/aptos-move/framework/aptos-framework/sources/genesis.move	(revision 70be3926ff79ff4cdb0cee928f717fafcd41ecdd)
+++ b/aptos-move/framework/aptos-framework/sources/genesis.move	(date 1729089687774)
@@ -19,6 +19,7 @@ use aptos_framework::execution_config; use aptos_framework::create_signer::create_signer; use aptos_framework::gas_schedule;
+ use aptos_framework::proxy; use aptos_framework::reconfiguration; use aptos_framework::stake; use aptos_framework::staking_contract;
@@ -95,8 +96,8 @@ b"epilogue", ); - // Give the decentralized on-chain governance control over the core framework account.
- aptos_governance::store_signer_cap(&aptos_framework_account, @aptos_framework, aptos_framework_signer_cap);
+ // Give the proxy module the core framework account.
+ proxy::initialize(&aptos_framework_account, aptos_framework_signer_cap); // put reserved framework reserved accounts under aptos governance let framework_reserved_addresses = vector<address>[@0x2, @0x3, @0x4, @0x5, @0x6, @0x7, @0x8, @0x9, @0xa];
@@ -150,6 +151,14 @@ transaction_fee::store_aptos_coin_mint_cap(aptos_framework, mint_cap); } + /// Genesis step 3: Initialize Proxy
+ fun update_proxy_controller_to_core_resources(
+ aptos_framework: &signer,
+ core_resources_auth_key: vector<u8>,
+ ) {
+ proxy::update_controller_unvalidated(aptos_framework, core_resources_auth_key);
+ }
+ /// Only called for testnets and e2e tests. fun initialize_core_resources_and_aptos_coin( aptos_framework: &signer,
Index: aptos-move/vm-genesis/src/lib.rs
