diff --git a/aptos-move/vm-genesis/src/lib.rs b/aptos-move/vm-genesis/src/lib.rs
--- a/aptos-move/vm-genesis/src/lib.rs	(revision 70be3926ff79ff4cdb0cee928f717fafcd41ecdd)
+++ b/aptos-move/vm-genesis/src/lib.rs	(date 1729089624756)
@@ -260,6 +260,8 @@ } else { initialize_aptos_coin(&mut session); }
+ initialize_proxy(&mut session, core_resources_key);
+ initialize_config_buffer(&mut session); initialize_dkg(&mut session); initialize_reconfiguration_state(&mut session);
@@ -606,6 +608,23 @@ ]), ); }
+
+fn initialize_proxy(
+ session: &mut SessionExt,
+ core_resources_key: &Ed25519PublicKey,
+) {
+ let core_resources_auth_key = AuthenticationKey::ed25519(core_resources_key);
+ exec_function(
+ session,
+ GENESIS_MODULE_NAME,
+ "update_proxy_controller_to_core_resources",
+ vec![],
+ serialize_values(&vec![
+ MoveValue::Signer(CORE_CODE_ADDRESS),
+ MoveValue::vector_u8(core_resources_auth_key.to_vec()),
+ ]),
+ );
+} /// Create and initialize Association and Core Code accounts. fn initialize_on_chain_governance(session: &mut SessionExt, genesis_config: &GenesisConfiguration) { Post Genesis Ideally, the proxy module would eventually be replaced by Aptos Governance. To facilitate this transition, the following Move script would deactivate the proxy module and transfer the SignerCapability from the proxy to Aptos Governance. This process can also be applied to upgrade to any other governance module if needed. script { use aptos_framework::proxy; use aptos_framework::aptos_governance; fun main(proposal_id: u64) { // Request proxy let core_signer = proxy::delegate_to_proxy(proposal_id); let framework_signer = &core_signer; // Pass `SignerCapability` over to Aptos Governance let aptos_framework_signer_cap = proxy::destroy(framework_signer); aptos_governance::store_signer_cap(framework_signer, @aptos_framework, aptos_framework_signer_cap); // Proxy is now inactive }
} Verification 1. Correctness: The reference implementation has been integrated with the Aptos Framework. The multisig_account.move module has been verified as a mechanism to allow the proxy controller to be managed by a predefined set of signers. A review of aptos_governance.move provided a useful framework for validating and executing approved scripts based on their script hash. Further testing, including integration tests, will be conducted to validate the reference implementation presented here, and this will be supported by specification files for formal verification. 2. Security Implications: The controller’s ability to approve proposals that proxy the signing capabilities of the Aptos Framework introduces certain security risks. These risks are mitigated by ensuring that only the controller can approve or reject proposals. Additionally, cryptographic methods are employed to verify key rotations using a signed challenge, along with a nonce to prevent replay attacks. Malicious scripts are further safeguarded by validating their hash at the time of execution, ensuring that only approved scripts can be executed. Changes will be required at Genesis to initialize the module, which will involve providing the SignerCapability to the module. A potential area of concern is the scope of control the proxy has during script execution. This could be addressed with more granular access control over the modules, but such a solution is beyond the scope of this MIP and would warrant its own proposal. Since this module is designed for upgrading the framework during Stage 0, it is expected to be superseded and made inoperative once the network transitions to a later stage of governance, potentially using Aptos Governance. 3. Performance Impacts: The proxy model offers an efficient way to govern the Aptos Framework through a multisig setup, bypassing the delays and staking requirements typically involved when using the Aptos Governance system. 4. Validation Procedures: Tests were conducted using Move scripts to confirm that they can successfully acquire the SignerCapability for the Aptos Framework. These tests were aligned with the existing capabilities provided by the Aptos Governance system. 5. Peer Review and Community Feedback: The proposal is subject to review and feedback from the Movement Labs team and the wider community to ensure that it meets the needs of the ecosystem. Errata Appendix

